import React from "react";
import Pagination from "../common/pagination";
import Loader from "../common/loader";
const EmailList = ({
  data,
  isLoading,
  totalData,
  setCurrentPage,
  currentPage,
  nPages,
}) => {
  return (
    <div className="emails">
      <div className="email-list">
        <div className="bg-white shadow-8 datatable_div  pt-7 rounded pb-8 px-2 ">
          <div className="table-responsive main_table_div">
            {isLoading ? (
              <Loader />
            ) : (
              <table className="table table-striped main_data_table">
                <thead>
                  <tr className="">
                    <th
                      scope="col"
                      className=" border-0 font-size-4 font-weight-normal"
                    >
                      ID
                    </th>
                    <th
                      scope="col"
                      className=" border-0 font-size-4 font-weight-normal"
                    >
                      <Link
                        to={""}
                        // onClick={() => {
                        //   handleSort("name");
                        //   props.setpageNo(1);
                        // }}
                        className="text-gray"
                        title="Sort by Name"
                      >
                        Subject
                      </Link>
                    </th>
                    <th
                      scope="col"
                      className="border-0 font-size-4 font-weight-normal"
                    >
                      <Link
                        to={""}
                        // onClick={() => {
                        //   handleSort("contact_no");
                        //   props.setpageNo(1);
                        // }}
                        className="text-gray"
                        title="Sort by Contact"
                      >
                        Sender
                      </Link>
                    </th>
                    {props.heading === "Dashboard" ? (
                      ""
                    ) : (
                      <th
                        scope="col"
                        className="border-0 font-size-4 font-weight-normal"
                      >
                        <Link
                          to={""}
                          // onClick={() => {
                          //   handleSort("language");
                          //   props.setpageNo(1);
                          // }}
                          className="text-gray"
                          title="Sort by Languages"
                        >
                          Seen
                        </Link>
                      </th>
                    )}
                    {props.heading === "Dashboard" ? (
                      ""
                    ) : (
                      <th
                        scope="col"
                        className="border-0 font-size-4 font-weight-normal"
                      >
                        <Link
                          to={""}
                          // onClick={() => {
                          //   handleSort("interested_in");
                          //   props.setpageNo(1);
                          // }}
                          className="text-gray"
                          title="Sort by interested in"
                        >
                          Date{" "}
                        </Link>
                      </th>
                    )}

                    {/*                     
                    {props.heading === "Dashboard" ||
                    user_type === "company" ? (
                      ""
                    ) : (
                      <th
                        scope="col"
                        className="border-0 font-size-4 font-weight-normal"
                      >
                        Action
                      </th>
                    )} */}
                  </tr>
                </thead>
                <tbody>
                  {/* Map function to show the data in the list*/}
                  {totalData === 0 || data.length === 0 ? (
                    <tr>
                      <th className="bg-white"></th>
                      <th className="bg-white"></th>
                      {/* {props.heading === "Dashboard" ? (
                        <th className="bg-white text-center">No Data Found</th>
                      ) : (
                        <th className="bg-white"></th>
                      )} */}
                      {/* <th className="bg-white"></th> */}
                      {/* {props.heading === "Dashboard" ? null : ( */}
                      <th className="bg-white text-center">No Data Found</th>
                      {/* )} */}
                      <th className="bg-white"></th>
                      {/* {props.heading !== "Dashboard" ? (
                        <>
                          <th className="bg-white"></th>
                          <th className="bg-white"></th>
                          <th className="bg-white"></th>
                          <th
                            className={
                              user_type === "company" ? "d-none" : "bg-white"
                            }
                          ></th>
                        </>
                      ) : (
                        ""
                      )} */}
                    </tr>
                  ) : (
                    (data || []).map((email, i) => (
                      <tr className="applicant_row" key={i}>
                        <td className=" py-5">
                          <p className="font-size-3 font-weight-normal text-black-2 mb-0">
                            <Link
                              className="text-dark"
                              // to={`/${email.employee_idmsgno}`}
                            >
                              {email.employee_idmsgno}
                            </Link>
                          </p>
                        </td>
                        <td className="py-5 ">
                          {email.subject === null ? (
                            <p className="font-size-3 mb-0">Unavailable</p>
                          ) : (
                            <p className="m-0">{email.subject}</p>
                          )}
                        </td>

                        {
                          // props.heading === "Dashboard" ? (
                          //   ""
                          // ) :
                          <td className=" py-5">
                            {email.sender === null ? (
                              <p className="font-size-3  mb-0">Unavailable</p>
                            ) : (
                              <h3 className="font-size-3 font-weight-normal text-black-2 mb-0">
                                <p className="text-gray font-size-2 m-0">
                                  <Link
                                    className="text-dark"
                                    to={`mailto:${email.sender}`}
                                  >
                                    {email.sender}
                                  </Link>
                                </p>
                              </h3>
                            )}
                          </td>
                        }
                        {
                          // props.heading === "Dashboard" ? (
                          //   ""
                          // ) :
                          <td className=" py-5">
                            {email.seen === null ? (
                              <p className="font-size-3  mb-0">Unavailable</p>
                            ) : (
                              <p className="font-size-3 font-weight-normal text-black-2 mb-0 text-truncate">
                                {email.seen}
                              </p>
                            )}
                          </td>
                        }
                        {
                          // props.heading === "Dashboard" ? (
                          //   ""
                          // ) :
                          <td className=" py-5">
                            {email.date === null || email.date === "" ? (
                              <p className="font-size-3  mb-0">Unavailable</p>
                            ) : (
                              <p className="font-size-3 font-weight-normal text-black-2 mb-0 text-truncate">
                                {email.date}
                              </p>
                            )}
                          </td>
                        }
                        {/* <td
                        className={
                          user_type === "company"
                            ? "d-none"
                            : " py-5 min-width-px-100"
                        }
                      >
                        <div
                          className={"btn-group button_group"}
                          role="group"
                          aria-label="Basic example"
                        >
                          <button
                            className={
                              user_type === "company"
                                ? "d-none"
                                : "btn btn-outline-info action_btn"
                            }
                            onClick={() => editVisa(email)}
                            title="Update Visa status"
                          >
                            <span className="text-gray px-2">
                              <LiaCcVisa />
                            </span>
                          </button>

                          <button
                            className={
                              user_type === "company" ||
                              props.page === "user_profile"
                                ? "d-none"
                                : "btn btn-outline-info action_btn"
                            }
                            onClick={() => AddDoucument(email)}
                            title="Documents"
                          >
                            <span className="text-gray">
                              <GrDocumentUser />
                            </span>
                          </button>
                          <button
                            className={"btn btn-outline-info action_btn"}
                            onClick={() => ShowDeleteAlert(email)}
                            title="Delete"
                          >
                            <span className=" text-danger px-1">
                              <RiDeleteBin5Line />
                            </span>
                          </button>
                        </div>
                      </td> */}
                      </tr>
                    ))
                  )}
                </tbody>
              </table>
            )}
          </div>
          <div className="pt-2">
            <Pagination
              nPages={nPages}
              currentPage={currentPage}
              setCurrentPage={setCurrentPage}
              total={totalData}
              count={data.length}
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default EmailList;
